import React from 'react';

const UrlList = ({ urls = [] }) => {
    if (!Array.isArray(urls) || urls.length === 0) {
        return <p className="no-urls">No URLs yet.</p>;
    }

    return (
        <ul className="url-list">
            {urls.map((item, idx) => (
                <li key={item.id ?? idx}>
                    <a href={item.shortUrl ?? '#'} target="_blank" rel="noopener noreferrer">
                        {item.shortUrl ?? item.url}
                    </a>
                    <div className="original">{item.url}</div>
                </li>
            ))}
        </ul>
    );
};

export default UrlList;
